# 8. Операторы / и // выполняют деление. В чем разница между ними?
#
# Оператор /(деление) -  возвращает результат типа (float), сохраняя все знаки после запятой.
#
# Оператор // (целочисленное деление) -  возвращает результат типа (int), округляя вниз до ближайшего целого.
#
# * 5 / 2 возвращает 2.5
# * 5 // 2 возвращает 2
# * -5 / 2 возвращает -2.5
# * -5 // 2 возвращает -3

