# 11. Как писать комментарии на Python? Для чего они нужны
# * Документирование кода - комментарии помогают объяснить, что делает тот или иной участок кода, его назначение, входные и выходные параметры и т.д. Это облегчает понимание кода другими разработчиками.
#
# * Временное отключение кода - комментированием можно временно отключить ненужный в данный момент код, не удаляя его полностью.
#
# * Аннотация кода - комментарии могут содержать дополнительную информацию о коде, например, возвращаемые типы, ограничения на входные параметры и т.п.
#
# Существует несколько способов писать комментарии в Python:

# 9
def my_function(var_a: int, var_b: int) -> int:
    """
    Возвращает сумму двух чисел a и b.

    Args:
        var_a (int): Первое число
        var_b (int): Второе число

    Returns:
        int: Сумма чисел a и b
    """
    return var_a + var_b


# Docstrings являются особым видом комментариев, которые используются для документирования функций, модулей, классов и других объектов Python.
#
# Комментарии помогают сделать код более понятным и поддерживаемым в долгосрочной перспективе. Они особенно важны в больших и сложных проектах, где нескольким разработчикам необходимо работать над одним кодом

# 12. Как изменить порядок выполнения операторов в Python?
# Помимо  основных способов, вы также можете использовать операторы возведения в степень **, унарные операторы +, -, ~ и другие операторы с определенными приоритетами.

# * Использование круглых скобок ( ): Круглые скобки имеют самый высокий приоритет и заставляют интерпретатор выполнять операции внутри них в первую очередь:

variable_x: int = 2 + 3 * 4  # результат: 14
variable_i: int = (2 + 3) * 4  # результат: 20
print(variable_x, variable_i)

# Использование квадратных скобок [ ]: Квадратные скобки используются для доступа к элементам последовательностей, таких как списки, кортежи, строки и т.д. Они также имеют высокий приоритет:

my_list: list[int] = [1, 2, 3]
variable_y: int = my_list[0] + 2  # результат: 3

# Использование фигурных скобок { }: Фигурные скобки используются для создания словарей и множеств. Они также имеют вы

# сокий приоритет:

my_dict: dict[str, int] = {"a": 1, "b": 2}
variable_z: int = my_dict["a"] + 2  # результат: 3
print(variable_z)

# Использование оператора вызова функции ( ): Когда вызывается функция, оператор вызова функции имеет высокий приоритет:

variable_u: int = my_function(2, 3) * 4  # результат: 20
print(variable_u)

# Использование атрибутов . : Доступ к атрибутам объектов, таких как методы и свойства, имеет высокий приоритет:

my_string: str = "hello"
variable_p: int = len(my_string) + 2  # результат: 7
print(variable_p)

